import { Routes, Route } from 'react-router-dom'

// pages & components
import Home from './pages/Home'
import Navbar from './components/Navbar'
import Login from './pages/Login'
import Signup from './pages/Signup'

function App() {
const user = JSON.parse(localStorage.getItem('user'))

const LoggingApp=()=>{

    <div className="App">

        <Navbar />
        <div className="pages">
          <Routes>
            <Route 
              path="/"
              element={<Signup />}
            />
            <Route 
              path="/login"
              element={<Login />}
            />
          </Routes>
        </div>

    </div>

}
const AuthApp=()=>{

    <div className="App">

        <Navbar />
        <div className="pages">
          <Routes>
            <Route 
              path="/"
              element={<Home/>}
            />


          </Routes>
        </div>

    </div>

}
  return(
user?AuthApp:LoggingApp
    )


}

export default App;
